import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the sort select using label text (alternative strategy)
    await page.waitForSelector('label[for="sortSelect"]', { timeout: 5000 });

    // Use XPath to find the select following the label "Sort by:"
    const [sortSelect] = await page.$x("//label[contains(text(), 'Sort by:')]/following-sibling::select[1]");
    if (!sortSelect) {
      throw new Error('Sort select not found via XPath');
    }

    // Select "Price: Low to High" by value
    await sortSelect.selectOption({ value: 'price-low' });

    // Wait for the product grid/list to update (wait for a product card to appear)
    await page.waitForSelector('.product-card, .product-card-list', { timeout: 5000 });

    // Take screenshot after applying sort
    const step2 = path.join(screenshotsDir, 'step_2_price_sort_applied.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract the titles and prices of the first 3 products to verify sort
    const products = await page.$$eval('.product-card, .product-card-list', nodes =>
      nodes.slice(0, 3).map(node => {
        const title = node.querySelector('.product-title')?.innerText || '';
        const priceText = node.querySelector('.product-price')?.innerText || '';
        // Extract price as number
        const priceMatch = priceText.match(/\$([\d,.]+)/);
        const price = priceMatch ? parseFloat(priceMatch[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    return {
      success: true,
      action: "Applied 'Price: Low to High' sort filter and verified product order",
      extractedData: {
        firstThreeProducts: products
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
